import React from 'react'
import './Card.css'
import { motion } from "framer-motion"


export default function Projects() {

    return (
      <motion.div
      initial={{ opacity: 0}}
      animate={{opacity: 1}}
      exit={{ opacity: 0}}
      >
            <div>
                ESTO ES EL PROJECTS 
            </div>
        </motion.div>
    );
  }
